    false,nt"url": null,nt"notes": "This narrative report for Missisquoi NWR
    outlines Refuge accomplishments from February through April of 1942. The report
    begins by summarizing the weather conditions and water conditions during this period.
    Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
    predators, rodents, and raptors- is also covered. The Refuge development and maintenance
    section discusses physical developments and plantings. The public relations section
    of the report describes recreational uses. Photographs are attached.",nt"owner_org":
